// src/components/ContactSection.jsx
import React from 'react';

export default function ContactSection() {
  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial', maxWidth: '600px', margin: 'auto' }}>
      <h2>Επικοινωνήστε μαζί μας</h2>
      <form onSubmit={(e) => { e.preventDefault(); alert("Εστάλη!"); }}>
        <label>Όνομα:<br /><input name="name" required /></label><br />
        <label>Email:<br /><input type="email" name="email" required /></label><br />
        <label>Μήνυμα:<br /><textarea name="message" rows={4} required /></label><br />
        <button type="submit">Αποστολή</button>
      </form>

      <h3>Βρείτε μας</h3>
      <iframe
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3145.5407824995715!2d23.7348!3d37.9755!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMzfCsDU4JzMxLjgiTiAyM3CsNDQnMDUuMyJF!5e0!3m2!1sel!2sgr!4v1234567890"
        width="100%"
        height="300"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
      />
    </div>
  );
}
